    englength,engde,CL,Mach);	
nacelCDL = NEng * CDLnac;
%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%CDnacTotal%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
nacelCD = nacelCD0 + nacelCDL;
%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%PYLON%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
%pag111
%%%%%%%%%%%%%%%%%%%%%%%%%%%%%CDp%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
if PEng == 1
        %%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%CD0%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
        %Calculo Rwfht pag 99
        Rwp=1.0;
        %Calculo Rlsht lifting surface correction fig 4.2 pag 57
        Cos_tcmaxp=cos(pylonsweep*rad);% cosseno do enflechamento em c/4
        %Interpolacao
        Rlsp=interp2(Rls_Cos,Rls_Mach,Rls_table,Cos_tcmaxp,Mach);
        %Calculo Cfvt friction coefficient of the wing figure 4.3 pag 58
        Rnp=(ro*Vcruz*pylonmac)/mi;
        %Interpolacao
        Cfp=interp2(Cfw_Rn,Cfw_Mach,Cfw_table,Rnp,Mach);
        % Calculo do CD0vt
        Ltcp=1.2;% localizacao do t/c max
        pylonCD0=2*(Rwp*Rlsp*Cfp*(1+Ltcp*pylontcmed+100*(pylontcmed^4))*(pylonSwet/Sref)); % eq 4.6 pag 56
        %%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%CDL%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
        
elseif  PEng == 2 || PEng ==3
       %Calculo Rwfht pag 99
        Rwp=1.0;

        %Calculo Rlsht lifting surface correction fig 4.2 pag 57
        Cos_tcmaxp=cos(pylonsweep*rad);% cosseno do enflechamento em c/4
        %Interpolacao
        Rlsp=interp2(Rls_Cos,Rls_Mach,Rls_table,Cos_tcmaxp,Mach);

        %Calculo Cfvt friction coefficient of the wing figure 4.3 pag 58
        Rnp=(ro*Vcruz*pylonmac)/mi;
        %Interpolacao
        Cfp=interp2(Cfw_Rn,Cfw_Mach,Cfw_table,Rnp,Mach);

        % Calculo do CD0vt
        Ltcp=1.2;% loclizacao do t/c max
        pylonCD0=2*(Rwp*Rlsp*Cfp*(1+Ltcp*pylontcmed+100*(pylontcmed^4))*(pylonSwet/Sref)); % eq 4.6 pag 56
 
else 
        %Calculo Rwfht pag 99
        Rwp=1.0;

        %Calculo Rlsht lifting surface correction fig 4.2 pag 57
        Cos_tcmaxp=cos(pylonsweep*rad);% cosseno do enflechamento em c/4
        Cos_tcmaxpout=cos(pylonsweepout*rad);
        %Interpolacao
        Rlsp=interp2(Rls_Cos,Rls_Mach,Rls_table,Cos_tcmaxp,Mach);
        Rlspout=interp2(Rls_Cos,Rls_Mach,Rls_table,Cos_tcmaxpout,Mach);
        %Calculo Cfvt friction coefficient of the wing figure 4.3 pag 58
        Rnp=(ro*Vcruz*pylonmac)/mi;
        Rnpout=(ro*Vcruz*pilone.macout)/mi;
        %Interpolacao
        Cfp=interp2(Cfw_Rn,Cfw_Mach,Cfw_table,Rnp,Mach);
        Cfpout=interp2(Cfw_Rn,Cfw_Mach,Cfw_table,Rnpout,Mach);
        % Calculo do CD0vt
        Ltcp=1.2;% localizacao do t/c max
        pylonCD0=2*(Rwp*Rlsp*Cfp*(1+Ltcp*pylontcmed+100*(pylontcmed^4))*(pylonSwet/Sref))...
                  +2*(Rwp*Rlspout*Cfpout*(1+Ltcp*pylontcmed+100*(pylontcmed^4))*(pilone.Swetout/Sref)); % eq 4.6 pag 56
end
%
pylonCD=pylonCD0;
%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%CDTOTAL%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
Airplane_CD0 = (asaCD0 + htCD0 + vtCD0 + fusCD0 + nacelCD0 + pylonCD0)*1.035; % taking into account 3.5% miscellaneous drag;
Airplane_CD  = asaCD+htCD+vtCD+fusCD+nacelCD+pylonCD;
end % 
